        "https://i2-prod.birminghammail.co.uk/incoming/article18651139.ece/ALTERNATES/s1200c/0_saka-shirt.jpg",
    },
  ]);
  return (
    <div className="card">
      <div className="card_container">
        {people.map((person) => (
          <TinderCard></TinderCard>
        ))}
      </div>
    </div>
  );
}

